sources.styles/blocks/art-museum.scss:
.art-museum {
  &__container {
    @include pageGrid;
  }

  &__photo {
    position: relative;
    grid-row: 1 / -1;
    grid-column: 1 / -1;
    padding-bottom: 107%;
    margin: 0 -20px;

    @include onTablet {
      grid-column: 4 / -1;
      margin-left: 0;
      margin-right: -34px;
      padding-bottom: 113%;
    }

    @include onDesktop {
      grid-column: 6 / -1;
      margin-right: -55px;
      padding-bottom: 98%;
    }

    img {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      object-fit: cover;
    }
  }

  &__content {
    grid-column: 1 / -1;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;

    @include onTablet {
      grid-column: 1 / span 3;
      align-items: start;
    }

    @include onDesktop {
      grid-column: 1 / span 5;
    }
  }

  &__title {
    grid-column: 1 / -1;
    margin-top: 20px;
    @include fontStyle("Montserrat", 45px, 700, 1, $color-black);
    text-align: center;

    @include onTablet {
      text-align: left;
      font-size: 54px;
      line-height: 120%;
    }

    @include onDesktop {
      font-size: 72px;
      font-weight: 700;
    }
  }

  &__links {
    display: flex;
    justify-content: center;
    align-items: end;
    width: 100%;

    @include onTablet {
      justify-content: start;
    }

    @include onDesktop {
      justify-content: space-between;
    }
  }

  &__events-link {
    display: none;
    user-select: none;

    @include onDesktop {
      position: relative;
      display: block;
      @include fontStyle($fw: 700, $color: $color-blue-gray-accent);
      text-transform: uppercase;
      transform: rotate(270deg);

      &::before {
        @include pseudo();
        right: calc(100% + 20px);
        top: 50%;
        width: 70px;
        height: 1px;
        transform: translate(0, -50%);
        pointer-events: none;
        background-color: $color-dark-green-accent;
      }

      @include hover(transform, translateX(-20px), $pseudo: "before");

    }
  }

  &__buy-tickets-link {
    position: relative;
    display: block;
    margin-top: 20px;
    padding: 18px 130px 18px 80px;

    @include fontStyle($fz: 16px, $fw: 500);
    border: 1px solid $color-dark-green-accent;

    &::after {
      @include pseudo(url(../images/art-museum/arrow.svg), flex);
      display: flex;
      align-items: center;
      justify-content: center;
      padding: 0 13px;
      right: 0;
      top: 0;
      height: 100%;
      background-color: $color-dark-green-accent;

      @include onTablet {
        padding: 0 23px;
      }

    }

    @include onTablet {
      max-width: 200px;
      margin-top: 38px;
      padding: 27px 138px 27px 68px;
    }

    @include onDesktop {
      margin-top: 95px;
    }

    transition: background-color 0.3s ease, color 0.3s ease;

    &:hover {
      background-color: $color-dark-green-accent;
      color: $color-white;
    }
  }
}

